import React from 'react';
import CompMenu from './CompMenu';
import { Outlet } from 'react-router-dom';

const CompSideBar = () => {
  return (
    <aside>
      <CompMenu/>
      <hr />
      <main>
        {/* 서브페이지 본문-(주소에 따라)본문마다 다른 내용이 들어간다. 이게 아웃렛 5.0은 다른방법임(1년됐음 6.0) */}
        <Outlet/> 
      </main>
      <hr />
      <div>서브페이지 공통광고</div>
    </aside>
  );
};

export default CompSideBar;
